function min(a, b){ return a < b ? a : b ; }
function max(a, b){ return a > b ? a : b; }

function getSvgSizesHArr(count, height){
  if(count === 1){
    return [height];
  }else if(count == 2){
    var value = height/4;
    return [value*3,value];
  }else if(count == 3){
    var value = height/4;
    return [value*2,value,value];
  }  
}

function setSvgSizes(windowsData){
  for (var i = 0; i < windowsData.length; i++) {
    var height = windowsData[i].height;
    var width = windowsData[i].width;    
    var childData = windowsData[i].childData;
    var arrSizes = getSvgSizesHArr(childData.length, height);
    for (var i = 0; i < childData.length; i++) {
      var tickScale = d3.scale.linear()
              .domain([0, height])
              .range([3, 18]);      

      childData[i].height = arrSizes[i];
      childData[i].width = width;
      childData[i].ticks = parseInt(tickScale(arrSizes[i]));
    };    
  }
  return windowsData;
}

function setZoom(){
  var svgContenedor = d3.select("body").selectAll("div")
                //valores correctos [27, 60]
                .call(d3.behavior.zoom().scaleExtent([25, 2650]).on("zoom", function(d){
                    d.scale = d3.event.scale;
                    buildWindows(windowsData);
                }));
}

function getData(windowName){
  for (var r = 0; r < windowsData.length; r++) {
      if(windowsData[r].name === windowName){
        for (var i = 0; i < dataRepository.length; i++) {
          if(dataRepository[i].source === windowsData[r].source && dataRepository[i].item === windowsData[r].item && dataRepository[i].range === windowsData[r].range){
            var data = dataRepository[i].data;
            var temp_max_length = max_length < data.length ? max_length : data.length;
            var scale = d3.scale.linear()
                    //.domain([0, 60])
                    .domain([0, 2650])
                    .range([0, temp_max_length]);

            var tempData = dataRepository[i].data.slice(dataRepository[i].data.length - scale(windowsData[r].scale));
            var tempOrderBook = dataRepository[i].orderBookData;
            //console.log(windowsData[r].scale);
            return  {"data": tempData, "orderBookData": tempOrderBook};
          };     
      }
    };  
  };
}

function getWindow(windowName){
  for (var r = 0; r < windowsData.length; r++) {
    if(windowsData[r].name === windowName){
      return windowsData[r];
    }
  };
}

function getWindowScale(windowName){
  return getWindow(windowName).scale;
}

function buildWindows(windowsData){
  var windows = d3.select("body")                    
                    .selectAll("div")                                  
                                  .data(windowsData)                                                                    
                                  .attr("style", function(d) { return "width:" + d.width + "px"; })
                                  .attr("id", function(d){ return d.name; })
                                  .attr('class', 'boxChart');
  windows.exit().remove();

  windows.enter().append("div")
                  .attr("style", function(d) { return "width:" + d.width + "px"; })
                  .attr("id", function(d){ return d.name; })
                  .attr('class', 'boxChart');

  

  windowsData = setSvgSizes(windowsData);
  windows.selectAll("svg").remove();
  var svgs = windows.selectAll("svg")
                          .data(function(d){ return d.childData; });

  svgs.attr('id', function(d){ return d.name })
      .attr("width", function(d){ return d.width; })
      .attr("height", function(d){ return d.height; })
      .each(function(dd, i) {
        if(dd.type === "candle"){ genCandleChartSvg(this, dd); }
        if(dd.type === "volume"){ genVolumeChartSvg(this, dd); } 
      });

  svgs.enter().append("svg").attr('id', function(d){ return d.name })
      .attr("width", function(d){ return d.width; })
      .attr("height", function(d){ return d.height; })
      .each(function(dd, i) {  
        if(dd.type === "candle"){ genCandleChartSvg(this, dd); }
        if(dd.type === "volume"){ genVolumeChartSvg(this, dd); }              
      });

  svgs.exit().remove();
}     

function updateWindowsData(windowName, childData, width, height, sourceOfData, itemData, range, callback){
  windowsData.push({ "name": windowName, "childData": childData, "width": width, "height": height, "source": sourceOfData, "item": itemData, "range": range, "scale": defaultScale });
  callback();
}

